Upload eats exceptions from its various listeners, making it almost impossible for my kind of developers to use it. Only a red message on the client side. This can be reproduced with e.g. following very simple configuration.

        Upload upload = new Upload();
        upload.addFinishedListener(e -> {
            System.err.println("Yes...");
            String foo = null;
            foo.length(); // this NPE is never reported anywhere
            System.err.println("WTF moment because I'm never reached");
        });

### Expected outcome

Exceptions should be thrown and reported somehow.

### Environment

- Vaadin 22
- Mac

### Browsers Affected
All
